package com.awu.raft.services.regression.strategy.handler.impl;import com.awu.raft.services.regression.strategy.handler.OrderHandlerType;import java.lang.annotation.Annotation;public class OrderHandlerTypeImpl implements OrderHandlerType {    private String source;    private String payMethod;    public OrderHandlerTypeImpl(String source, String payMethod) {        this.source = source;        this.payMethod = payMethod;    }    @Override    public String source() {        return this.source;    }    @Override    public String payMethod() {        return this.payMethod;    }    @Override    public Class<? extends Annotation> annotationType() {        return OrderHandlerType.class;    }    @Override    public boolean equals(Object o) {        if (!(o instanceof OrderHandlerType)) {            return false;        }        OrderHandlerType other = ((OrderHandlerType) o);        return source.equals(other.source()) && payMethod.equals(other.payMethod());    }    @Override    public int hashCode() {        int hashCode = 0;        hashCode += (127 * "source".hashCode()) ^ source.hashCode();        hashCode += (127 * "payMethod".hashCode()) ^ payMethod.hashCode();        return hashCode;    }}